import React, {useState} from 'react';
import { BrowserRouter, Route, Switch, Redirect, userParams } from 'react-router-dom';
import './App.css';
import IndexPage from './pages/IndexPage/IndexPage';

const  App = () => {
  return (
        <BrowserRouter>
          <Switch>
            <Route path="/" exact component = {IndexPage}  />
          </Switch>
        </BrowserRouter>
  ) 
}

export default App;
